import { useFormikContext } from "formik";
import React from "react";

const AddSubmitButton = ({ title, ...props }) => {
    const { handleSubmit } = useFormikContext();

    return (
        <button onClick={handleSubmit} {...props}>
            {title}
        </button>
    );
};

export default AddSubmitButton;
